/* eslint-disable react/prop-types */
import React from 'react';

const Posts = ({ posts }) => (
  <div>
    <ul>
      {posts.map(post => (
        <li key={post.title}>{post.body}</li>
      ))}
    </ul>
  </div>
);

export default Posts;
